  b 15.02.1925
  b 11.03.1927
  Roger b. at Gisborne and m, at Auckland. Zélie, d/o William Wood Meek
  (barrister of Auckland) and Sybil Carter. Address: 2/226 Victoria Avenue,
  Remuera, Auckland 5.
  Roger was educated at Wanganui Collegiate School and Auckland and Massey
  Universities (BAgSc). He worked for ICI(NZ) Ltd in Wellington (13 years) and
  Auckland, holding a number of senior appointments culminating in CEO of
  Fibremakers NZ Ltd. He retired in 1983 and practised for the next ten years as a management consultant
  in Auckland.
  Both Roger and Zélie were active with the Samaritan Movement during their years in Wellington. During
  ww2 he served in the Royal Navy (on secondment from the RNZN) in the Indian Ocean and Europe.
  Zélie was educated at Diocesan School for Girls in Auckland and trained as a kindergarten teacher,
  leaving the service as a director to marry. She trained as a singer and became well-known in Auckland
  as a soprano. She is presently one of an A Capella trio performing regularly in Auckland.
  01> MACLEAN, Victoria Claire m on 09.10.1987 to SHAKES, Brian Grant
  b 20.10.1957
  b 14.01.1960
  Victoria m. at Auckland. Brian b, at Auckland, Address: 79 Waiatarua Road,
  Remuera, Auckland.
  Victoria was educated at Diocesan School for Girls in Auckland and Queen
  Margaret College in Wellington. She trained as a legal secretary and is
  now working with special needs children.
  Brian was educated in Auckland and graduated BSc and MSc (Hons) from
  Auckland University. In 1994 he gained his MBA and is now working as a project manager with
  Telecom.
